import React, { Fragment } from 'react';
import Navbar from '../components/Navbar'

const Layout = ({children}) =>{
    return (
        <Fragment>
            <Navbar>
                {children}
            </Navbar>
            
        </Fragment>
        
    );
}

export default Layout;
